<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8" />
<title>BOM Tracker - Sinclair ZX Spectrum 48K rev 3B</title>

<style>
:root {
  color-scheme: dark;
  --bg: #05060a;
  --bg-alt: #10131b;
  --fg: #e5e9f0;
  --fg-muted: #9fa6b2;
  --accent: #66fcf1;
  --border: #2e3440;
  --font: system-ui, -apple-system, BlinkMacSystemFont, "Segoe UI", sans-serif;
}

* { box-sizing: border-box; }

body {
  margin: 0;
  font-family: var(--font);
  background: radial-gradient(circle at top left, #1b2838 0, #05060a 45%, #000 100%);
  color: var(--fg);
}

header {
  padding: 0.75rem 1rem;
  background: #0b0d14;
  border-bottom: 1px solid var(--border);
}

header h1 {
  margin: 0;
  font-size: 1.1rem;
}

header p {
  margin: 0.25rem 0 0;
  font-size: 0.8rem;
  color: var(--fg-muted);
}

.toolbar {
  padding: 0.5rem 1rem;
  display: flex;
  flex-wrap: wrap;
  gap: 0.5rem;
  border-bottom: 1px solid var(--border);
  background: #090b11;
}

.toolbar button {
  background: var(--bg-alt);
  color: var(--fg);
  border: 1px solid var(--border);
  border-radius: 4px;
  padding: 0.25rem 0.6rem;
  font-size: 0.8rem;
  cursor: pointer;
}

.toolbar button:hover {
  border-color: var(--accent);
}

.toolbar span {
  font-size: 0.8rem;
  color: var(--fg-muted);
}

main {
  padding: 0.75rem 1rem 1.5rem;
}

/* ===== RESIZABLE SPLIT ===== */
.layout {
  display: flex;
  height: calc(100vh - 140px);
  min-width: 0;
  gap: 0.75rem;
}

.layout-left {
  flex: 1 1 0;
  min-width: 150px;
}

.layout-right {
  flex: 0 0 450px;
  min-width: 200px;
  max-width: 80%;
  resize: horizontal;
  overflow: auto;
  position: relative;
  background: #090b11;
  border: 1px solid var(--border);
  border-radius: 4px;
  padding: 0.5rem;
  display: flex;
  flex-direction: column;
}

.layout-right h2 {
  margin: 0 0 0.5rem;
  font-size: 0.9rem;
  color: var(--fg-muted);
}

.silk-inner {
  flex: 1 1 auto;
  border: 1px solid #1b2230;
  background: #05060a;
  display: flex;
  align-items: flex-start;
  justify-content: flex-start;
  overflow: auto;
}

/* ===== ZOOMABLE SILKSCREEN ===== */
#silkImage {
  width: auto;
  height: auto;
  max-width: none;
  max-height: none;
  display: block;
  transform-origin: top left;
  filter: invert(1) sepia(1) saturate(5) hue-rotate(10deg) brightness(1.4);
}

/* ===== BOM TABLE ===== */
table {
  width: 100%;
  border-collapse: collapse;
  font-size: 0.8rem;
  background: #0b0d14;
  border: 1px solid var(--border);
}

thead {
  background: #11141d;
}

thead th {
  padding: 0.4rem 0.5rem;
  text-align: left;
  border-bottom: 1px solid var(--border);
  font-weight: 600;
  color: var(--fg-muted);
}

tbody td {
  padding: 0.3rem 0.5rem;
  border-bottom: 1px solid #1b2230;
  vertical-align: middle;
}

tr.category-row {
  background: #151c26;
  font-weight: 700;
  color: var(--accent);
}

tr.value-row {
  background: #11141d;
  font-weight: 600;
  color: var(--fg);
}

tr.component-row:nth-child(even) {
  background: #10131b;
}

tr.component-row:nth-child(odd) {
  background: #0d1017;
}

.toggle-btn {
  background: transparent;
  border: none;
  color: var(--fg-muted);
  cursor: pointer;
  margin-right: 0.3rem;
  font-size: 0.8rem;
}

.toggle-btn:hover {
  color: var(--accent);
}

.label-strong {
  font-weight: 600;
}

.ref-cell {
  font-family: ui-monospace, SFMono-Regular, Menlo, Monaco, Consolas, "Liberation Mono", "Courier New", monospace;
  font-size: 0.8rem;
}

.notes-cell {
  font-size: 0.75rem;
  color: var(--fg-muted);
}

.checkbox-cell {
  text-align: center;
  width: 6%;
}

input[type="checkbox"] {
  width: 1rem;
  height: 1rem;
  cursor: pointer;
  accent-color: var(--accent);
}

@media (max-width: 900px) {
  thead th:nth-child(5),
  tbody td:nth-child(5) {
    display: none;
  }
  .layout {
    flex-direction: column;
    height: auto;
  }
  .layout-right {
    flex: 0 0 auto;
    max-width: 100%;
    resize: none;
  }
}
</style>
</head>

  <h1>BOM Tracker - Sinclair ZX Spectrum 48K rev 3B</h1>
  <p>Bambleweeny57 - Submeson Brain Corporation</p>

/* ===== LOCAL STORAGE PREFIX ===== */
const LS_PREFIX = "bom_nested_v1:";

function parseBool(str) {
  return String(str).trim().toUpperCase() === "TRUE";
}

function parseBom(raw) {
  const lines = raw.split(/\r?\n/).filter(l => l.trim().length > 0);
  const header = lines[0].split("\t");
  const idx = {
    category: header.indexOf("Category"),
    value: header.indexOf("Value"),
    component: header.indexOf("Component"),
    rating: header.indexOf("Rating"),
    notes: header.indexOf("Notes"),
    sourced: header.indexOf("Sourced"),
    placed: header.indexOf("Placed"),
  };

  const items = [];

  for (let i = 1; i < lines.length; i++) {
    const cols = lines[i].split("\t");
    const category = (cols[idx.category] || "").trim();
    const value = (cols[idx.value] || "").trim() || "Unknown";
    const compField = (cols[idx.component] || "").trim();
    const rating = (cols[idx.rating] || "").trim();
    const notes = (cols[idx.notes] || "").trim();
    const sourcedInit = parseBool(cols[idx.sourced] || "");
    const placedInit = parseBool(cols[idx.placed] || "");

    const refs = compField ? compField.split(/\s+/).filter(Boolean) : [];

    if (refs.length > 0) {
      for (const ref of refs) {
        items.push({
          category,
          value,
          ref,
          rating,
          notes,
          sourcedInit,
          placedInit,
        });
      }
    } else {
      items.push({
        category,
        value,
        ref: value + " #1",
        rating,
        notes,
        sourcedInit,
        placedInit,
      });
    }
  }

  return items;
}

function groupByCategoryAndValue(items) {
  const categories = new Map();
  for (const it of items) {
    if (!categories.has(it.category)) {
      categories.set(it.category, new Map());
    }
    const valueMap = categories.get(it.category);
    if (!valueMap.has(it.value)) {
      valueMap.set(it.value, []);
    }
    valueMap.get(it.value).push(it);
  }

  const result = [];
  for (const [cat, valueMap] of categories.entries()) {
    const values = Array.from(valueMap.entries())
      .sort((a, b) => a[0].localeCompare(b[0], undefined, { numeric: true }))
      .map(([value, items]) => ({ value, items }));
    result.push({ category: cat, values });
  }
  return result;
}

function lsKeyForRef(ref) {
  return LS_PREFIX + "ref:" + ref;
}

function loadState(key, fallback) {
  const v = localStorage.getItem(key);
  if (v === null) return fallback;
  return v === "1";
}

function saveState(key, value) {
  localStorage.setItem(key, value ? "1" : "0");
}

function clearAllState() {
  const keys = [];
  for (let i = 0; i < localStorage.length; i++) {
    const k = localStorage.key(i);
    if (k && k.startsWith(LS_PREFIX)) keys.push(k);
  }
  keys.forEach(k => localStorage.removeItem(k));
}

function updateSummary(struct) {
  let total = 0, sourced = 0, placed = 0;
  for (const cat of struct) {
    for (const val of cat.values) {
      for (const item of val.items) {
        total++;
        const base = lsKeyForRef(item.ref);
        if (loadState(base + ":sourced", item.sourcedInit)) sourced++;
        if (loadState(base + ":placed", item.placedInit)) placed++;
      }
    }
  }
  document.getElementById("summaryText").textContent =
    `${total} components â€¢ ${sourced} sourced â€¢ ${placed} placed`;
}

function render(struct) {
  const tbody = document.getElementById("bomBody");
  tbody.innerHTML = "";

  const categoryStates = [];

  for (const cat of struct) {
    const catRow = document.createElement("tr");
    catRow.className = "category-row";

    const tdCat = document.createElement("td");
    tdCat.colSpan = 7;
    const btn = document.createElement("button");
    btn.className = "toggle-btn";
    btn.textContent = "â–¸";
    btn.title = "Expand/collapse category";
    const label = document.createElement("span");
    label.className = "label-strong";
    label.textContent = cat.category || "Uncategorised";
    tdCat.appendChild(btn);
    tdCat.appendChild(label);
    catRow.appendChild(tdCat);
    tbody.appendChild(catRow);

    const valueStates = [];

    for (const val of cat.values) {
      const valueRow = document.createElement("tr");
      valueRow.className = "value-row";

      const firstItem = val.items[0] || {};
      const commonRating = firstItem.rating || "";
      const commonNotes = firstItem.notes || "";

      const tdV0 = document.createElement("td");
      const vBtn = document.createElement("button");
      vBtn.className = "toggle-btn";
      vBtn.textContent = "â–¸";
      vBtn.title = "Expand/collapse value group";
      tdV0.appendChild(vBtn);
      tdV0.appendChild(document.createTextNode(val.value));

      const tdV1 = document.createElement("td");
      tdV1.textContent = val.value;

      const tdV2 = document.createElement("td");
      tdV2.textContent = `${val.items.length} refs`;

      const tdV3 = document.createElement("td");
      tdV3.textContent = commonRating;

      const tdV4 = document.createElement("td");
      tdV4.className = "notes-cell";
      tdV4.textContent = commonNotes;

      const tdVS = document.createElement("td");
      tdVS.className = "checkbox-cell";
      const vSourcedCb = document.createElement("input");
      vSourcedCb.type = "checkbox";
      tdVS.appendChild(vSourcedCb);

      const tdVP = document.createElement("td");
      tdVP.className = "checkbox-cell";
      const vPlacedCb = document.createElement("input");
      vPlacedCb.type = "checkbox";
      tdVP.appendChild(vPlacedCb);

      valueRow.appendChild(tdV0);
      valueRow.appendChild(tdV1);
      valueRow.appendChild(tdV2);
      valueRow.appendChild(tdV3);
      valueRow.appendChild(tdV4);
      valueRow.appendChild(tdVS);
      valueRow.appendChild(tdVP);

      tbody.appendChild(valueRow);

      const compRows = [];

      for (const item of val.items) {
        const tr = document.createElement("tr");
        tr.className = "component-row";

        const tdC0 = document.createElement("td");
        tdC0.textContent = "";

        const tdC1 = document.createElement("td");
        tdC1.textContent = item.value;

        const tdC2 = document.createElement("td");
        tdC2.className = "ref-cell";
        tdC2.textContent = item.ref;

        const tdC3 = document.createElement("td");
        tdC3.textContent = item.rating || "";

        const tdC4 = document.createElement("td");
        tdC4.className = "notes-cell";
        tdC4.textContent = item.notes || "";

        const tdCS = document.createElement("td");
        tdCS.className = "checkbox-cell";
        const cS = document.createElement("input");
        cS.type = "checkbox";
        tdCS.appendChild(cS);

        const tdCP = document.createElement("td");
        tdCP.className = "checkbox-cell";
        const cP = document.createElement("input");
        cP.type = "checkbox";
        tdCP.appendChild(cP);

        tr.appendChild(tdC0);
        tr.appendChild(tdC1);
        tr.appendChild(tdC2);
        tr.appendChild(tdC3);
        tr.appendChild(tdC4);
        tr.appendChild(tdCS);
        tr.appendChild(tdCP);

        tbody.appendChild(tr);

        compRows.push({ tr, cS, cP, item });
      }

      valueStates.push({
        valueRow,
        vBtn,
        vSourcedCb,
        vPlacedCb,
        compRows,
      });
    }

    categoryStates.push({
      catRow,
      btn,
      valueStates,
    });
  }

  for (const catState of categoryStates) {
    let catExpanded = false;

    const setValueExpanded = (vState, exp) => {
      vState.expanded = exp;
      vState.vBtn.textContent = exp ? "â–¾" : "â–¸";
      for (const r of vState.compRows) {
        r.tr.style.display = exp ? "" : "none";
      }
    };

    const setCatExpanded = (exp) => {
      catExpanded = exp;
      catState.btn.textContent = exp ? "â–¾" : "â–¸";
      for (const vState of catState.valueStates) {
        vState.valueRow.style.display = exp ? "" : "none";
        if (!exp) {
          setValueExpanded(vState, false);
        }
      }
    };

    setCatExpanded(false);
    for (const vState of catState.valueStates) {
      setValueExpanded(vState, false);

      let allS = true, anyS = false;
      let allP = true, anyP = false;

      for (const row of vState.compRows) {
        const base = lsKeyForRef(row.item.ref);
        const s = loadState(base + ":sourced", row.item.sourcedInit);
        const p = loadState(base + ":placed", row.item.placedInit);
        row.cS.checked = s;
        row.cP.checked = p;
        if (s) anyS = true; else allS = false;
        if (p) anyP = true; else allP = false;
      }

      vState.vSourcedCb.checked = allS && anyS;
      vState.vSourcedCb.indeterminate = anyS && !allS;
      vState.vPlacedCb.checked = allP && anyP;
      vState.vPlacedCb.indeterminate = anyP && !allP;

      vState.vBtn.addEventListener("click", () => {
        setValueExpanded(vState, !vState.expanded);
      });

      vState.vSourcedCb.addEventListener("change", () => {
        const checked = vState.vSourcedCb.checked;
        vState.vSourcedCb.indeterminate = false;
        for (const row of vState.compRows) {
          row.cS.checked = checked;
          const base = lsKeyForRef(row.item.ref);
          saveState(base + ":sourced", checked);
        }
        updateSummary(struct);
      });

      vState.vPlacedCb.addEventListener("change", () => {
        const checked = vState.vPlacedCb.checked;
        vState.vPlacedCb.indeterminate = false;
        for (const row of vState.compRows) {
          row.cP.checked = checked;
          const base = lsKeyForRef(row.item.ref);
          saveState(base + ":placed", checked);
        }
        updateSummary(struct);
      });

      for (const row of vState.compRows) {
        row.cS.addEventListener("change", () => {
          const base = lsKeyForRef(row.item.ref);
          saveState(base + ":sourced", row.cS.checked);

          let allS2 = true, anyS2 = false;
          for (const r of vState.compRows) {
            if (r.cS.checked) anyS2 = true; else allS2 = false;
          }
          vState.vSourcedCb.checked = allS2 && anyS2;
          vState.vSourcedCb.indeterminate = anyS2 && !allS2;
          updateSummary(struct);
        });

        row.cP.addEventListener("change", () => {
          const base = lsKeyForRef(row.item.ref);
          saveState(base + ":placed", row.cP.checked);

          let allP2 = true, anyP2 = false;
          for (const r of vState.compRows) {
            if (r.cP.checked) anyP2 = true; else allP2 = false;
          }
          vState.vPlacedCb.checked = allP2 && anyP2;
          vState.vPlacedCb.indeterminate = anyP2 && !allP2;
          updateSummary(struct);
        });
      }
    }

    catState.btn.addEventListener("click", () => {
      setCatExpanded(!catExpanded);
    });
  }

  document.getElementById("expandAllBtn").onclick = () => {
    for (const catState of categoryStates) {
      if (catState.btn.textContent === "â–¸") catState.btn.click();
    }
  };

  document.getElementById("collapseAllBtn").onclick = () => {
    for (const catState of categoryStates) {
      if (catState.btn.textContent === "â–¾") catState.btn.click();
    }
  };

  document.getElementById("clearStateBtn").onclick = () => {
    if (!confirm("Clear all saved Sourced/Placed state for this BOM in this browser?")) return;
    clearAllState();
    location.reload();
  };

  updateSummary(struct);
}

/* ===== SILKSCREEN ZOOM + INIT ===== */
let silkZoom = 1;

document.addEventListener("DOMContentLoaded", () => {
  const items = parseBom(rawBom);
  const struct = groupByCategoryAndValue(items);
  render(struct);

  const img = document.getElementById("silkImage");
  if (img) {
    img.addEventListener("wheel", e => {
      e.preventDefault();
      const delta = e.deltaY < 0 ? 0.1 : -0.1;
      silkZoom = Math.min(8, Math.max(0.2, silkZoom + delta));
      img.style.transform = `scale(${silkZoom})`;
    });
  }
});
</script>
